import React from 'react';
import {  } from 'reactstrap';
import Logo from './restaurant.png'

class ListRestaurants extends React.Component {
  render() {
    return (
      <React.Fragment>
        <div className="page-header d-flex align-items-center">
          <div className='mr-auto row'>
            <div className='col'><img  src={Logo} alt='loading...' className='img'/></div>
            <div className='col align-items-center'><h2>Restaurants</h2></div>
          </div>
        </div>
      </React.Fragment>
    )
  }
}

export default ListRestaurants;
